JS JS TIME
chapter 5. For - of

1. Duck Typing
Duck Typing이란, 클래스의 상속이나 인터페이스의 구현으로 자료형을 판단하는 것이 아닌, 인스턴스의 값이나 속성을 기준으로 해당 객체를 판단하겠다는 의미입니다.


컴퓨터 프로그래밍 분야에서 덕 타이핑(duck typing)은 동적 타이핑의 한 종류로, 객체의 변수 및 메소드의 집합이 객체의 타입을 결정하는 것을 말한다. 
https://ko.wikipedia.org/wiki/%EB%8D%95_%ED%83%80%EC%9D%B4%ED%95%91


Duck Typing과 자바스크립트는 매우 밀접한 관계에 있습니다. 이는 자바스크립트가 동적 타입 언어임에서 부터 기인합니다. 


비유적으로 설명하자면,
Static type의 세상에선 누군가 요리를 하기 위해서 자격증을 발급받아야 하지만, Dynamic Type의 세상에선 요리를 배우기만 하면된다. 즉, 요리를 시키기 위해서 요리사 자격증을 확인해야하는지, 요리를 할 수 있는지를 알아야하는지의 차이이다.


대표적인 예시로 오리에 관한 이야기가 있습니다. Duck Typing이 유래된 Duck Test에 관한 코드입니다.
class Bird {
  quack () {
    console.log('꽥 꽥!')
  }

  walk () {
    console.log('뒤뚱 뒤뚱!')
  }
}

class Person {
  quack () {
    console.log('나는 오리로 분장했어요.')
  }

  walk () {
    console.log('뒤뚱 뒤뚱 오리처럼 걸어요!')
  }
}


Bird나 Person이나 모두 quack처럼 울 수 있고 walk로 걸을 수 있으니 오리로 간주하겠다는 것이죠.
